document
	.querySelectorAll('.js-scroll')
	.forEach( function( element ) {
		element.addEventListener('click', function( event ) {
			event.preventDefault();
			var hash = element.getAttribute('href');
			var t = document.querySelector( hash );
			t.scrollIntoView({ behavior: 'smooth' });
			window.location.hash = hash;
			t.focus();
		});
});

document
	.querySelectorAll('.js-expand')
	.forEach( function( element ) {
		element.addEventListener('click', function( event ) {
			event.preventDefault();
			var i = element.getAttribute('data-expand');
			var s = element.getAttribute('data-section');
			var t = document.querySelector( i );

			AU.animate.Run({
				element: document.querySelectorAll('.js-expandable-' + s + ':not(' + i + ')'),
				property: 'height',
				endSize: 0,
				speed: 300,
			});

			AU.animate.Toggle({
				element: t,
				property: 'height',
				speed: 300,
			});

			t.focus();
		});
});
